import axios from 'axios';

import { tokenHeader } from '../headersauth';

import { GET_DATAS, DELETE_DATA, ADD_DATA } from './types';

// GET LEADS
export const getDATAS = () => (dispatch, getState) => {
  axios
    .get('/api/project/', tokenHeader(getState))
    .then((res) => {
      dispatch({
        type: GET_DATAS,
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
  }
// DELETE LEAD
export const deleteDATA = (id) => (dispatch, getState) => {
  axios
    .delete(`/api/project/${id}/`, tokenHeader(getState))
    .then((res) => {

      dispatch({
        type: DELETE_DATA,
        payload: id,
      });
    })
    .catch((err) => console.log(err));
};

// ADD LEAD
export const addDATA = (lead) => (dispatch, getState) => {
  axios
    .post('/api/project/', lead, tokenHeader(getState))
    .then((res) => {

      dispatch({
        type: ADD_DATA,
        payload: res.data,
      });
    })
    .catch((err) => console.log(err));
};
